import React, {useState, useContext} from 'react';
import {Card, Alert } from 'react-bootstrap';
import {useAuth} from './Contexts/Authcontext';
import { useNavigate, Link} from 'react-router-dom';
import {DoctorContext} from './Contexts/DoctorContext';
import Doctor from './Doctor/Doctor';

export default function Profile() {

    const [error, setError]=useState("");
    const { currentUser, logout} = useAuth();
    const navigate = useNavigate();

    const {appointmentList} = useContext(DoctorContext);

    async function handleLogout(e) {
        e.preventDefault();
        setError('')

        try {
            await logout();
            navigate('/login');
        } catch {
            setError('Failed to log out')
        }
    };


    return (
        <div className="profile-container" style={{padding: "10px"}}>
            <Card>
                <Card.Body>
                    <div className="profile-container">
                        <Card.Title>Profile</Card.Title>
                            {error && <Alert variant="danger">{error}</Alert>}
                            <ListGroup variant="flush">
                                <ListGroup.Item>
                                    <strong>Email: </strong> {currentUser.email}
                                </ListGroup.Item>
                                <ListGroup.Item>
                                    <strong>Company: </strong> {(currentUser.email).split('@')[1]}
                                </ListGroup.Item>
                            </ListGroup>
                    </div>

                    <div className="appointment-list">
                        {/* <Doctor /> */}
                    </div>

                    <div className="logout-container"> 
                        <Link to="/login"><div className="logout" onClick={handleLogout} style={{color: "black"}}> Log Out </div></Link>
                    </div>

                </Card.Body>
            </Card>
        </div>
    )
}
